package cn.com.evo.integration.nxsp.pay.model;import org.apache.commons.lang3.builder.ToStringBuilder;import java.util.Arrays;/** * @Description: * @author: rf * @create: 2019-04-17 5:56 PM **/public class GetAuthorityInfoResponse {    private Integer is_purchased;    private String play_token;    private String auth_random_sn;    private Integer ret;    private String ret_msg;    private String message;    @Override    public String toString() {        return new ToStringBuilder(this)                .append("is_purchased", is_purchased)                .append("play_token", play_token)                .append("auth_random_sn", auth_random_sn)                .append("ret", ret)                .append("ret_msg", ret_msg)                .append("message", message)                .toString();    }    public Integer getIs_purchased() {        return is_purchased;    }    public void setIs_purchased(Integer is_purchased) {        this.is_purchased = is_purchased;    }    public String getPlay_token() {        return play_token;    }    public void setPlay_token(String play_token) {        this.play_token = play_token;    }    public String getAuth_random_sn() {        return auth_random_sn;    }    public void setAuth_random_sn(String auth_random_sn) {        this.auth_random_sn = auth_random_sn;    }    public Integer getRet() {        return ret;    }    public void setRet(Integer ret) {        this.ret = ret;    }    public String getRet_msg() {        return ret_msg;    }    public void setRet_msg(String ret_msg) {        this.ret_msg = ret_msg;    }    public String getMessage() {        return message;    }    public void setMessage(String message) {        this.message = message;    }}